import React from 'react';
import Item from './Item';
import Popup from './Popup';

export default function ItemList(props) {
  const { products, onAdd, onRemove, deleteItem, onPurchase, show, handleClose, toDelete } = props;
 
  return (
    <div>
      <div>
        {products.length === 0 && <div>Cart is empty</div>}
        {products.map((product) => (
          <>
            <Item key={product.id} product={product} onAdd={onAdd} onRemove={onRemove} deleteItem={deleteItem} onPurchase={onPurchase} handleShow={handleShow}></Item>
            <Popup show={show} handleClose={handleClose} toDelete={toDelete} product={product}></Popup>
          </>
        ))}
      </div>
    </div>
  );
}
